    false,nt"url": null,nt"notes": "Intertidal organism and habitat data were
    collected in the Gulf of Alaska from the HUMDINGER as part of Outer Continental
    Shelf Environmental Assessment Program (OCSEAP). Data were collected by Dames and
    Moore Incorporated from 20 April 1976 to 24 August 1976. Data were processed by
    NODC to NODC standard F030 Intertidal Organism and Habitat format. Full format description
    is available from NODC at www.nodc.noaa.gov/General/NODC-Archive/f030.html. An analog
    file for this accession is available from NODC user services.nnThe F030 format is
    used for data from field sampling of marine organisms in intertidal or subtidal
    habitats. The data are collected to provide information about species abundance
    and distribution. Data from each observation may include: cruise and station information
    such as vessel name, senior scientist, position, date, and time; environmental conditions
    such as surface temperature and salinity, wind speed and direction, and sea state;
    sediment and habitat descriptors; and species identification and organism counts
    and measurements. Data may be reported for either individual or composite samples.
    A text record is available for reporting comments.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
